export default class RedirectRoute {

    setRedirectForTwitterExplore(props, url) {
        if(props.twitterExploreForCategories) {
            this.props.history.replace(url);
        }
        if(props.twitterExplore) {
            this.props.history.replace(url);
        }
    }
}
